import SignUp from "./Components/SignUp";
import SignIn from "./Components/SignIn";
import { useRoutes } from "react-router-dom";
import { Home } from "@mui/icons-material";

function App() {
  const element = useRoutes([
    {
      path: "/",
      element: <SignIn />,
    },
    {
      path: "register",
      element: <SignUp />,
    },
    {
      path: "home",
      element: <Home />,
    },
  ]);
  return element;
}

export default App;
